! function(a) {
    "use strict";
    var b = document.getElementById("line-basic");
    if (b == null) { return }
    var b = b.getContext('2d');
    window.myLine = new Chart(b, {
        type: "line",
        data: {
            labels: ["00:00", "03:00", "06:00", "12:00", "15:00", "18:00", "21:00"],
            datasets: [{
                label: "Tendencia",
                backgroundColor: window.chartColors.blue,
                borderColor: window.chartColors.blue,
                data: [randomScalingFactor(), randomScalingFactor(), randomScalingFactor(), randomScalingFactor(), randomScalingFactor(), randomScalingFactor(), randomScalingFactor()],
                fill: !1
            }]
        },
        options: {
            responsive: !0,
            title: {
                display: !0,
                text: "Transaction Summary"
            },
            label: {
                display: "hidden"
            },
            tooltips: {
                mode: "index",
                intersect: !1
            },
            hover: {
                mode: "nearest",
                intersect: !0
            },
            scales: {
                xAxes: [{
                    display: !0,
                    scaleLabel: {
                        display: !0,
                        labelString: "Hora"
                    }
                }],
                yAxes: [{
                    display: !0,
                    scaleLabel: {
                        display: !0,
                        labelString: "Cantidad de usuarios"
                    }
                }]
            }
        }
    })
}(jQuery);